  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.scss']
})
export class FooterComponent {

}
<footer>
    <div class="content">
        <app-logo> </app-logo>
        <a href="https://github.com/gheinzer/sinv"><img src="assets/icons/github.svg" alt="" class="github-logo" /></a>
        <p>
